const Voter = (props) => {
    const item = props.item;
  return (
    <tr>
      <td>{item.v_id}</td>
      <td>{item.name}</td>
      <td>{item.address}</td>
      <td>{item.email}</td>
      <td>{item.dob}</td>
      <td class="action">Delete</td>
    </tr>
  );
};

export default Voter;
